import React from 'react';
import { Layout, Menu, Row } from 'antd';

const Navbar = () => {
    return (
        <Layout.Header>
            <Row justify="end">
                <Menu mode="horizontal" selectable={false}>
                    <Menu.Item key={1}>Логин</Menu.Item>
                </Menu>
            </Row>
        </Layout.Header>
    );
};

export default Navbar;
